const container = document.getElementById("container");
const image_count = 5;
let current_number = 1;

function getImage(number) {
  const createImage = document.getElementById("img");
  createImage.src = `images/image-${number}.jpg`;
  return "";
}

function leftButtonClickHandler() {
  const left = document.createElement("button");
  left.setAttribute("class", "btn")
  left.innerText = "back";
  left.onclick = () => {
    if (current_number <= 1) return false;
    current_number -= 1;
    getImage(current_number);
  };
  return left;
}

function rightButtonClickHandler() {
  const right = document.createElement("button");
  right.setAttribute("class", "btn")
  right.innerText = "next";
  right.onclick = () => {
    if (current_number > (image_count-1)) return false;
    current_number += 1;
    getImage(current_number);
  };
  return right;
}

function text(txt) {
  const text = document.createElement("p");
  text.innerHTML = txt;
  return text;
}

function emptySpan(number){
  const span = document.createElement("span")
  span.innerHTML = `${new Array(number).fill("&nbsp").join("")}`
  return span;
}

function div() {
  const div = document.createElement("div");
  div.appendChild(text("<b>Image:</b> UnSplash"));
  div.appendChild(leftButtonClickHandler());
  div.appendChild(emptySpan(5));
  div.appendChild(rightButtonClickHandler());
  return div;
}

container.append(getImage(current_number), div());



